import React from 'react';

//this is the JObs components fetches jobs from API and renders them
class Jobs extends React.Component {
    constructor() {
        super();
        this.state = {
            jobs: []
        }
    }

    async componentDidMount() {
        let jobs = await fetch('https://jobs.github.com/positions.json?search=node', {
            mode: "no-cors" ,
            headers: {
                "Access-Control-Allow-Origin": "*"
            }
        });

        console.log(jobs);
    }
    render() {
        return (
            <div className="jobs">
            </div>
        )
    }

}

export default Jobs;
